          "title": "Late Late Lie Detector w/ Kris and Kylie Jenner",
          "description": "Beloved momager Kris Jenner gets strapped into a lie detector to face questions from James and her \"favorite child\" Kylie Jenner, all to be judged by our cranky resident polygraph professional, John. Kris is asked whether or not she helped release Kim's sex tape, if she liked Kourtney's wedding dress, if Corey Gamble is husband material, and most importantly, if Kendall has finally learned how to cut a cucumber.\n\nMore Late Late Show:\nSubscribe: http://bit.ly/CordenYouTube\nWatch Full Episodes: http://bit.ly/1ENyPw4\nFacebook: http://on.fb.me/19PIHLC\nTwitter: http://bit.ly/1Iv0q6k\nInstagram: http://bit.ly/latelategram\nTikTok: http://https://www.tiktok.com/@latelateshow\n\nWatch The Late Late Show with James Corden weeknights at 12:35 AM ET/11:35 PM CT on CBS and streaming on Paramount+.\n\n\n---\nEach week night, THE LATE LATE SHOW with JAMES CORDEN throws the ultimate late night after party with a mix of celebrity guests, edgy musical acts, games and sketches. Corden differentiates his show by offering viewers a peek behind-the-scenes into the green room, bringing all of his guests out at once and lending his musical and acting talents to various sketches. Additionally, bandleader Reggie Watts and the house band provide original, improvised music throughout the show. Since Corden took the reigns as host in March 2015, he has quickly become known for generating buzzworthy viral videos, such as Carpool Karaoke.\""
